T_IMP_ENTITY.SQL_TEXT:
declare
    v_count number;

begin

    select count(xitor_id)
      into v_count
      from xitor
     where xitor_key = ':reg_key'
       and xitor_type_id = 100006903 /*Registration*/;

	if v_count = 0 then
        :VALUE := null;
	else
        raise pkg_imp_run.e_skip_row;
	end if;

end;
